import React from "react";
import artworks from "../data/artworks";

function ArtworkList({ onSelect }) {
  return (
    <div>
      <h2>작품을 선택해주세요</h2>
      <ul>
        {artworks.map((art) => (
          <li key={art.id}>
            <button onClick={() => onSelect(art)}>{art.name}</button>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ArtworkList;
